председатель (заместители председателя) и члены комиссий по проверке знания требований охраны труда;
работники, проводящие инструктаж по охране труда;
специалисты по охране труда;
члены комитетов (комиссий) по охране труда:
уполномоченные (доверенные) лица по охране труда профессиональных союзов и иных уполномоченных работниками представителей органов организаций;
лица, назначенное на микропредприятии работодателем для проведения проверки знания требований охраны труда;
работники организации, отнесенные к категории специалисты;
работники рабочих профессий.
